import React, { Component } from 'react';
import search from '../../../_assets/images/menu/search.svg';
import VerticalScrollbars from '../../../_assets/Scrollbars/VerticalScrollbars';
import { Collapse } from 'reactstrap';
export default class Systems extends Component {
    constructor(props) {
        super(props);
        this.toggle = this.toggle.bind(this);
        this.toggle1 = this.toggle1.bind(this);
        this.toggle2 = this.toggle2.bind(this);
        this.toggle3 = this.toggle3.bind(this);
        this.toggle4 = this.toggle4.bind(this);
      this.toggle5 = this.toggle5.bind(this);
      this.toggle01 = this.toggle0.bind(this);
        this.toggle11 = this.toggle1.bind(this);
        this.toggle12 = this.toggle2.bind(this);
        this.toggle13 = this.toggle3.bind(this);
        this.toggle14 = this.toggle4.bind(this);
        this.toggle15 = this.toggle5.bind(this);

        this.state = {
            collapse: false,
            collapse1: false,
            collapse2: false,
            collapse3: false,
            collapse4: false,
            collapse5: false};
      }

      toggle() {
        this.setState(state => ({ collapse: !state.collapse }));
      }
      toggle1() {
        this.setState(state => ({ collapse1: !state.collapse1 }));
      }
      toggle2() {
        this.setState(state => ({ collapse2: !state.collapse2 }));
      }
      toggle3() {
        this.setState(state => ({ collapse3: !state.collapse3 }));
      }
      toggle4() {
        this.setState(state => ({ collapse4: !state.collapse4 }));
      }
      toggle5() {
        this.setState(state => ({ collapse5: !state.collapse5 }));
      }
  render() {
    return (
      <VerticalScrollbars  style={{ width: 350 }}  autoHide>
      <div className="org_browser">
        <h3 className="text-center text-white">Systems and Flows</h3>
        <div className="org-selector">
          <p className="text-white text-left">Selector</p>
          <input type="text" className="search-input" />
          <img src={ search } alt="starlify" className="search-icon" />
        </div>
                <div className="systems w-100 d-inline-block">

          <VerticalScrollbars style={{ height: 150 }}>
            <p className="text-white click" onClick={this.toggle} style={{ marginBottom: '1rem' }}>Systems</p>
            <Collapse isOpen={this.state.collapse}>
                <p className="text-white click" onClick={this.toggle1} style={{ marginBottom: '1rem', marginLeft: '2rem' }}>Subsystems</p>
                <Collapse isOpen={this.state.collapse1}>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Reference</p>
                </Collapse>
                        </Collapse>
                        <p className="text-white click" onClick={this.toggle2} style={{ marginBottom: '1rem' }}>Systems</p>
            <Collapse isOpen={this.state.collapse2}>
                <p className="text-whitev" onClick={this.toggle3} style={{ marginBottom: '1rem', marginLeft: '2rem' }}>Subsystems</p>
                <Collapse isOpen={this.state.collapse3}>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Reference</p>
                </Collapse>
                        </Collapse>
                        <p className="text-white" onClick={this.toggle4} style={{ marginBottom: '1rem' }}>Systems</p>
            <Collapse isOpen={this.state.collapse4}>
                <p className="text-white" onClick={this.toggle5} style={{ marginBottom: '1rem', marginLeft: '2rem' }}>Subsystems</p>
                <Collapse isOpen={this.state.collapse5}>
                                <p className="text-white" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Reference</p>
                </Collapse>
            </Collapse>
            </VerticalScrollbars>
        </div>
        <div className="team">
        <VerticalScrollbars style={{ height: 150 }}>
            <p className="text-white click" onClick={this.toggle} style={{ marginBottom: '1rem' }}>Systems</p>
            <Collapse isOpen={this.state.collapse}>
                <p className="text-white click" onClick={this.toggle1} style={{ marginBottom: '1rem', marginLeft: '2rem' }}>Subsystems</p>
                <Collapse isOpen={this.state.collapse1}>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Reference</p>
                </Collapse>
                        </Collapse>
                        <p className="text-white click" onClick={this.toggle2} style={{ marginBottom: '1rem' }}>Systems</p>
            <Collapse isOpen={this.state.collapse2}>
                <p className="text-whitev" onClick={this.toggle3} style={{ marginBottom: '1rem', marginLeft: '2rem' }}>Subsystems</p>
                <Collapse isOpen={this.state.collapse3}>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Service</p>
                                <p className="text-white click" style={{ marginBottom: '1rem', marginLeft: '3rem' }}>Reference</p>
                </Collapse>
                        </Collapse>
                        <p className="text-white" onClick={this.toggle4} style={{ marginBottom: '1rem' }}>Systems</p>
            <Collapse isOpen={this.state.collapse4}>
                <p className="text-white" onClick={this.toggle5} style={{ marginBottom: '1rem', marginLeft: '2rem' }}>Subsystems</p>
                <Collapse isOpen={this.state.collapse5}>
